import React, { useContext } from 'react';
import ExpenseItem from './Item';
import { AppContext } from '../context/AppContext';

const List = () => {
    const { expenses } = useContext(AppContext);

    return (
        <table classdepartment='table'>
              <thead classdepartment="thead-light">
            <tr>
              <th scope="col">Department</th>
              <th scope="col">Allocated Budget</th>
              <th scope="col">Increase by 10</th>
              <th scope="col">Decrease by 10</th>
              <th scope="col">Remove</th>
            </tr>
          </thead>
            <tbody>
            {expenses.map((expenses) => (
                <ExpenseItem id={expenses.id} key={expenses.id} department={expenses.department} quantity={expenses.quantity} unitbudget={expenses.unitbudget} />
            ))}
            </tbody>
        </table>
    );
};

export default List;
